import copyimport kerasimport numpy as npimport tensorflow as tffrom model import get_modelfrom scripts.data_preprocess import get_dataclass LossLogger(tf.keras.callbacks.Callback):    def on_train_batch_end(self, batch, logs=None):        with open("training_loss_log.txt", "a") as f:            f.write(f"Batch {batch}, Loss: {logs['loss']:.6f}\n")    def main():    x_train, x_test, y_train, y_test = get_data('../orcd/scratch/sudoku_data/sudoku.csv')        print('data retrieved')        model = get_model()        adam = keras.optimizers.Adam(lr=.001)    model.compile(loss='sparse_categorical_crossentropy', optimizer=adam)        model.fit(x_train, y_train, batch_size=32, epochs=1, callbacks=[LossLogger()])        print('done')if __name__ == "__main__":    main()